def _kanji2(kanji):
    idx=jpkanji.index(kanji)
    return cnkanji[idx]

def injpchar(char):
    return char in jpchar

def inChinese(ch):
    return '\u4e00' <= ch <= '\u9fff'

def modi2chikana(text, c2c=True):
    text = str(text)
    newtext = ""
    for idx,char in enumerate(text):
        if char in replichar:
            newtext += text[idx-1]
        elif char in jpcndict:
            newtext += jpcndict[char]
        else:
            if c2c:
                if char == 'ん' or char == 'ン':
                    newtext += r' <phoneme alphabet="ipa" ph="ɴɴ">n</phoneme>. '
                elif char == 'は' or char == 'ハ':
                    newtext += r'<phoneme alphabet="ipa" ph="hä">ha</phoneme>'
                elif char== 'っ':
                    newtext += "停顿"
                elif char=='ー':
                    newtext += '长音'
                else:
                    newtext += char
            else:
                newtext += char
        if char in jpchar and c2c:
            newtext += ","
    text = newtext
    if c2c:
        for long in longer:
            split = long[0] + "," + long[1]
            text = text.replace(split, long)

    newtext = ""
    state = -1
    newtexts = []
    cursor = 0
    while cursor < len(text):
        if text[cursor] == ',':
            if newtext != "":
                newtext += ","
            cursor += 1
            continue
        newstate=state
        if inChinese(text[cursor]):
            newstate = 2
        # if text[cursor] in jpchar:
        #     newstate = 1
        else:
            newstate=1
        if state == -1 or newstate == state:
            newtext += text[cursor]
            state = newstate
        else:
            newtexts.append((state,newtext))
            newtext = text[cursor]
            state = newstate
        cursor += 1
    if newtext != "":
        newtexts.append((state,newtext))
    return newtexts
